import React from 'react';

const Navbar = ({ currentPage, onNavigate, currentUser, onLogout }) => {
  return (
    <nav style={{
      background: 'white',
      boxShadow: '0 -4px 20px rgba(0, 0, 0, 0.1)',
      padding: '12px 0 20px 0',
      position: 'fixed',
      bottom: 0,
      left: 0,
      right: 0,
      zIndex: 100,
      borderTop: '1px solid #f0f0f0'
    }}>
      <div style={{
        display: 'flex',
        justifyContent: 'space-around',
        alignItems: 'center',
        maxWidth: '100%',
        position: 'relative'
      }}>
        {/* Home */}
        <button 
          onClick={() => onNavigate('dashboard')}
          style={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            gap: '6px',
            padding: '8px 16px',
            background: 'none',
            border: 'none',
            cursor: 'pointer',
            fontSize: '11px',
            fontWeight: '600',
            transition: 'all 0.3s ease',
            color: currentPage === 'dashboard' ? '#4CAF50' : '#8E8E93',
            minWidth: '70px'
          }}
        >
          <div style={{
            width: '28px',
            height: '28px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            borderRadius: '8px',
            background: currentPage === 'dashboard' ? 'rgba(76, 175, 80, 0.1)' : 'transparent'
          }}>
            <i className="fas fa-home" style={{ 
              fontSize: '18px',
              color: currentPage === 'dashboard' ? '#4CAF50' : '#8E8E93'
            }}></i>
          </div>
          <span>Home</span>
        </button>

        {/* Add Button - Floating */}
        <button 
          onClick={() => onNavigate('upload')}
          style={{
            position: 'relative',
            width: '56px',
            height: '56px',
            borderRadius: '50%',
            background: 'linear-gradient(135deg, #4CAF50, #45a049)',
            border: 'none',
            cursor: 'pointer',
            boxShadow: '0 4px 16px rgba(76, 175, 80, 0.4)',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            transition: 'all 0.3s ease',
            transform: currentPage === 'upload' ? 'scale(1.1)' : 'scale(1)'
          }}
        >
          <i className="fas fa-plus" style={{ 
            fontSize: '24px',
            color: 'white'
          }}></i>
        </button>

        {/* History */}
        <button 
          onClick={() => onNavigate('history')}
          style={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            gap: '6px',
            padding: '8px 16px',
            background: 'none',
            border: 'none',
            cursor: 'pointer',
            fontSize: '11px',
            fontWeight: '600',
            transition: 'all 0.3s ease',
            color: currentPage === 'history' ? '#FF9800' : '#8E8E93',
            minWidth: '70px'
          }}
        >
          <div style={{
            width: '28px',
            height: '28px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            borderRadius: '8px',
            background: currentPage === 'history' ? 'rgba(255, 152, 0, 0.1)' : 'transparent'
          }}>
            <i className="fas fa-history" style={{ 
              fontSize: '18px',
              color: currentPage === 'history' ? '#FF9800' : '#8E8E93'
            }}></i>
          </div>
          <span>History</span>
        </button>
      </div>

      {/* Logout Button - Top Right */}
      <button
        onClick={onLogout}
        style={{
          position: 'absolute',
          top: '-50px',
          right: '16px',
          width: '40px',
          height: '40px',
          borderRadius: '50%',
          background: 'rgba(255, 255, 255, 0.9)',
          border: '1px solid #e0e0e0',
          cursor: 'pointer',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          boxShadow: '0 2px 8px rgba(0, 0, 0, 0.1)',
          transition: 'all 0.3s ease'
        }}
      >
        <i className="fas fa-sign-out-alt" style={{ 
          fontSize: '16px',
          color: '#666'
        }}></i>
      </button>
    </nav>
  );
};

export default Navbar;
